import { useSelector } from 'react-redux'
import { Spinner, Button } from "react-bootstrap"
import { TableList } from "../TableList/TableList"
import { allTables } from '../../redux/tablesRedux'


export const Home = () => {
    const tables = useSelector(state => allTables(state))
    return(
        <div>
            <h1>All tables</h1>
            {typeof tables[0] === 'object' ? <TableList tables={tables} /> : <Spinner animation="border" />}
            <br></br>
            <Button href='/add_table'variant="primary">Add table</Button>
        </div>       
    )
}
